// SPDX-License-Identifier: MIT
pragma solidity 0.8.0;


contract SafeSmartContract {
    // Token Kilitleme Mekanizması
    // Kullanıcıların tokenlerini kilitleyebilecekleri yapı
struct Locker {
    uint256 amount; // Kilitlenen token miktarı
    uint256 unlockTime; // Tokenlerin kilidinin açılacağı zaman
    uint256 reward; // Kullanıcının kazandığı ödül miktarı
}

    // Her kullanıcının (adresin) Locker yapısını saklayan bir mapping
mapping(address => Locker) public lockers;

// Token kilitleme fonksiyonu
function lockTokens(uint256 _amount, uint256 _durationInDays) public {
    require(lockers[msg.sender].amount == 0, "Zaten kilitli tokenleriniz var");
    // TODO: Token transfer işlemleri (_amount miktarında token'ı sözleşmeye transfer etmek)
    lockers[msg.sender] = Locker({
        amount: _amount,
        unlockTime: block.timestamp + _durationInDays * 1 days,
        reward: calculateReward(_amount, _durationInDays) // Ödül miktarını hesapla ve ayarla

    });
}

// Token kilidini açma fonksiyonu
function unlockTokens() public {
     require(lockers[msg.sender].unlockTime <= block.timestamp , "Henuz kilidin acilma zamani gelmedi");
        // TODO: Token transfer işlemleri (kilitli tokenleri kullanıcıya geri transfer etmek)
    lockers[msg.sender].amount = 0;
}

 function calculateReward(uint256 _amount, uint256 _durationInDays) internal pure returns (uint256) {
        // Ödül miktarını hesapla (örneğin, kilit süresine göre lineer bir ödül)
        return _amount * _durationInDays / 100;
    }

function test() public {
        // Test 1: Token kilidini acma
        unlockTokens();
        
        // Test 2: Token kilitleme
        lockTokens(100, 0); // Kilit süresini 0 olarak ayarla
        assert(lockers[msg.sender].amount == 100);
        assert(lockers[msg.sender].unlockTime == block.timestamp);

        // Test 3: Ödül hesaplama
        uint256 reward = lockers[msg.sender].reward;
        assert(reward == 0); // 0 günlük kilit süresi için ödül

        // Test 4: Token kilidini acma
        unlockTokens();
        assert(lockers[msg.sender].amount == 0);
    }
}

